package com.example.sulthan.demobansos.ui.dashboard.kategori

import android.content.Intent
import android.os.Bundle
import androidx.fragment.app.Fragment
import android.view.LayoutInflater
import android.view.View
import android.view.ViewGroup
import android.widget.Toast
import androidx.recyclerview.widget.LinearLayoutManager
import com.example.sulthan.demobansos.R
import com.example.sulthan.demobansos.adapter.KategoriAdapter
import com.example.sulthan.demobansos.pojo.Pojo
import com.example.sulthan.demobansos.ui.DetailWarungActivity
import kotlinx.android.synthetic.main.fragment_minyak.*
import kotlinx.android.synthetic.main.fragment_sarden.*


class SardenFragment : Fragment() {

    override fun onCreate(savedInstanceState: Bundle?) {
        super.onCreate(savedInstanceState)
    }

    override fun onCreateView(
        inflater: LayoutInflater, container: ViewGroup?,
        savedInstanceState: Bundle?
    ): View? {
        // Inflate the layout for this fragment
        return inflater.inflate(R.layout.fragment_sarden, container, false)
    }

    override fun onViewCreated(view: View, savedInstanceState: Bundle?) {
        super.onViewCreated(view, savedInstanceState)

        val listkategori = listOf(
            Pojo.Kategori(
                name = "Sarden ABC",
                image = "data:image/jpeg;base64,"
            ),
            Pojo.Kategori(
                name = "Sarden Markecel",
                image = "data:image/jpeg;base64,"
            ),
            Pojo.Kategori(
                name = "Sarden King Fisher",
                image = "data:image/jpeg;base64,"
            ),
            Pojo.Kategori(
                name = "Sarden Fiesta",
                image = "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTCxc2Ud23LLOrM375I3rdBvK78FZck0QwlTw&usqp=CAU"
            ),
            Pojo.Kategori(
                name = "Sarden ayam brand",
                image = "data:image/jpeg;base64,"
            ),
            Pojo.Kategori(
                name = "Sarden maya tomato",
                image = "data:image/jpeg;base64,"
            ),
            Pojo.Kategori(
                name = "Sarden botan",
                image = "data:image/jpeg;base64,"
            ),
            Pojo.Kategori(
                name = "Sarden Gaga",
                image = "data:image/jpeg;base64,"
            )

        )

        val kategoriAdapter = KategoriAdapter(listkategori) {
            kategori ->
            Toast.makeText(activity, " clicked ${kategori.name},", Toast.LENGTH_SHORT).show()
            val intent = Intent(activity, DetailWarungActivity::class.java)
            startActivity(intent)
        }

        rv_main_sarden.apply {
            layoutManager = LinearLayoutManager(activity)
            adapter = kategoriAdapter
        }
    }

}

